import random
n=random.randint(1,99)
guess=int(input("Guess an number 1-99"))
while n != guess:
    if guess<n:
        print("Guess is too low")
        guess = int(input("Guess an number 1-99"))
    elif guess>n:
        print("guess is too high")
        guess = int(input("Guess an number 1-99"))
else:
    print("guess is correct")
